import React from "react";
import { DataGrid } from "@mui/x-data-grid";
import { useState,useEffect } from "react";
import axios from "axios";

const columns = [
    {
      field: "id",
      headerName: "ID",
      width: 80,
      sortable: false,
    },
    {
      field: "username",
      headerName: "Username",
      sortable: false,
      flex: 1,
      width: 150,
    },
    { field: "Date", headerName: "Date of register", sortable: false, width: 180 },
    { field: "time", headerName: "Time of register", width: 180 },
  ];


const DataTable = () => {

    const [users, setusers] = useState([]);    

    useEffect(() => {
        const getUsers = async () => {
          try {
            const res = await axios.get(`http://localhost:4000/user/getusers`);
            const usersWithId = res.data.reverse().map((user, index) => ({
              id: index + 1, 
              ...user,
            }));
            setusers(usersWithId);
          } catch (error) {
            console.log(error);
          }
        };
        getUsers();
      }, []);
      

  return (
    <div style={{ height: 400, width: "100%" }}>
      <DataGrid
        rows={users}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        disableColumnMenu
        disableSelectionOnClick
        getRowId={(row) => row._id}
      />
    </div>
  );
};

export default DataTable;
